import Header from "../../components/header";
import Head from "../../components/head";
import { Menu } from "antd";
 
const accountSett = ()=>{

    const [current , setCurrent] = useState('Account');

    const handleClick = e =>{
        setCurrent(e.key);
    }
    return(
        <div className="body">
            <Header/>
            <Head title="Paramètres | 6Solutions"/>
            <div className="parmHeader">
                <h1 className="title">Paramètres</h1>
            </div>
            <div className="parmBody">
                <Menu onClick={handleClick} selectedKeys={current} mode="vertical" style={{marginTop :'3%'}}>
                    <Menu.Item key="Account"  >
                        Compte
                    </Menu.Item>
                    <Menu.Item key="Privacy" >
                    Confidentialité et conditions de service
                    </Menu.Item>
                </Menu>
            </div>
        </div>
    )
}
export default accountSett ;
